- APAV;
- Liga dos Amigos do Hospital de S. Francisco Xavier;
- Associação Reintegrar;
- Associação de Psicogerontologia;

- Deputado na IX e X Legislaturas;
- Vice-Presidente da Bancada do GP/PSD;
- Presidente da Subcomissão Parlamentar dos Direitos Fundamentais e Comunicação Social;
- Presidente do Conselho de Direcção do Canal Parlamento;
- Director do Jornal "Povo Livre";
- Secretário-Geral Adjunto do PSD;

